import { Component } from '@angular/core';

@Component({
  selector: 'app-genre-ranking',
  templateUrl: './genre-ranking.component.html',
  styleUrls: ['./genre-ranking.component.css']
})
export class GenreRankingComponent {

}

async function getGenres()
{
  fetch('https://localhost:7110/Genres')
  .then(response => response.json())
  .then(data => {
    console.log(data[0].name); // Use the response data as needed
  })
  .catch(error => {
    console.error('Error:', error);
  });

}
getGenres();
